INSERT INTO `productos` VALUES (1,'Mariposa Monarca y Valle de Bravo Un lugar Mgico!','<p>Cada ao, este sitio es sede de un espectculo natural fascinante: la migracin de la mariposa monarca, un fenmeno exclusivo de esta especie, la cual puede identificarse por su color naranja, negro y blanco. Las monarcas dependen del algodoncillo para su supervivencia, y las orugas se alimentan exclusivamente de esta planta. Despus de la migracin anual a Mxico, las mariposas hembras adultas regresan a las reas donde crece el algodoncillo para poner los huevos. Durante el invierno, las amantes de la naturaleza provenientes de Mxico y de todo el mundo visitan la regin para tomar un tour por la reserva.&nbsp;</p>\n\n<p></p><p>Un tour espectacular!</p>','2016-10-02 00:00:00','2016-10-09 23:59:00',11573,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33373/44fd1511afff763a5e16eb7a40ff1f069c385621.full.jpg',92,'pueblos mgicos,tlalpujahua,el oro,michoacan,tour 1 dia,autobus,guia','0000-00-00 00:00:00','0000-00-00 00:00:00'),(2,'XLIV Festival Internacional Cevantino Guanajuato te espera!','<p>El Festival Internacional Cervantino (FIC) es el encuentro cultural y artstico ms notable de Amrica Latina y uno de los ms emblemticos en el mundo.Durante ms de cuatro dcadas ha sido foro de las expresiones ms vitales del arte tradicional y contemporneo. Por sus escenarios han pasado lo mismo Ella Fitzgerald que B.B. King, Martha Graham y Akira Kasai, Leonard Bernstein y Ricardo Muti, as como Ute Lemper y Rubn Blades.Este 2016, para su cuadragsima cuarta edicin el FIC llevar a cabo la celebracin ms importante a nivel mundial en homenaje a Cervantes, al dar cita a las ms destacadas expresiones de teatro, msica y danza en torno a este autor, al tiempo que abrir mltiples espacios de reflexin y discusin sobre su obra y vigencia.</p><p>Te lo recomendamos totalmente, diversin garantizada!</p>','2016-10-02 00:00:00','2016-10-18 23:59:00',44496,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33374/ea54a585e30d3a7cff6a923096457e02935ac4ee.full.jpg',30,'guia,festival,cervantino,guanajuato,2 dias,1 noche,transporte,guia de viaje','0000-00-00 00:00:00','0000-00-00 00:00:00'),(3,'FIG 2016 con Transporte y Entrada LTIMOS 12 LUGARES!','<p>Posicionado como uno de los 3 principales eventos de aerostacin del mundo, el FIG te trae un espectculo nico en Mxico y Latinoamrica, con un cielo lleno de colores presentando cientos de globos procedentes de todo el mundo, ms de 30 figuras especiales y un sinfn de horas de eventos diseados para toda la familia.</p><p>No te pierdas los increbles despegues por la maana, todas las actividades que tendremos para ti durante el da, para terminar con las espectaculares Noches mgicas; un incleble show de msica, luces y pirotecnia, con globos anclados a tierra, seguidos de nuestros conciertos presentando artistas de talla internacional.&nbsp;</p><br><p>No te pierdas de esta gran fiesta!</p>','2016-10-02 00:00:00','2016-11-15 23:59:00',31370,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33372/0e8acab18629906ec0241d454ecdb2f60bfe5666.full.jpg',47,'festival del globo,fig,2016,leon,globo,tour 1 dia,familiar','0000-00-00 00:00:00','0000-00-00 00:00:00'),(4,'Tajn y Tecolutla LTIMOS LUGARES, 09 OCTUBRE 429MXN!','<p>En medio de la selva, rodeada por el verde de los rboles y el azul del cielo, se alzan diversos edificios que conforman El Tajn, lo que alguna vez fue la capital de los totonacas. Se encuentra en la parte norte de Veracruz a pocos kilmetros del Pueblo Mgico de Papantla.</p><p>Se cree que el nombre El Tajn significa ciudad del trueno, haciendo alusin a un antiguo dios a quien le solicitaban lluvias. Hoy en da es reconocida como Patrimonio mundial por la UNESCO debido a la belleza de sus construcciones y a la importancia histrica y cultural que aporta al pas.&nbsp;</p><p>Explrala y sorprndete con sus pirmides y monumentos dedicados al dios-trueno!\n\n</p>\n\n<p>Tecolutla, conjugando en su nombre toda una serie de lugares paradisacos, el estado de Veracruz es en s mismo, una entidad turstica y cultural nica en su gnero, en donde podremos pasar una linda tarde en la playa y comiendo a la orilla del mar.\n\n</p>\n\n\n\n<p>El maravilloso estado de Veracruz te sorprende con un destino lleno de belleza natural!\n\n</p><br>','2016-10-03 00:00:00','2016-10-06 23:59:00',55661,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33375/bd7f230d5a621af6a7e89b79a917baa849612dcc.full.jpg',24,'tecolutla,tajin,playa,zona ,arqueologica,piramides','0000-00-00 00:00:00','0000-00-00 00:00:00'),(5,'SI TU NO VUELVES Comedia Musical! 40%','<p>Conforman esta historia dos personajes protagnicos (Miguel Martnez y\n\n Roberta Burns); un dueto de cantantes y cinco msicos. Historia que revela la relacin de Juancho, un joven a la vez rebelde y soador, repartidor de comida a domicilio y Tasia, actriz, que renunciando a la alta sociedad se da a la aventura de sobrevivir por sus propios medios.&nbsp;</p><p>Comedia romntica que relata, a travs de canciones y melodas diversas, sobre un decorado de imgenes cambiantes, la ausencia de identidad, la bsqueda de la felicidad en pareja, la prdida y la evolucin espiritual.&nbsp;</p><p><strong>SI TU NO VUELVES</strong> Comedia/Concierto; un espectculo enrgico, vital, revelador, divertido, entraable.</p>','2016-10-03 00:00:00','2016-10-08 23:59:00',65314,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33377/d4141efc2771a2d7474f706a16f0b871348b798d.full.png',43,'obra,teatro,vuelves,concierto,comedia','0000-00-00 00:00:00','0000-00-00 00:00:00'),(6,'Atrvete a entrar a ... La Jaula de las Locas 50%','<p>Regresa a Mxico 22 aos despus de su xito durante la temporada de estreno. Esta espectacular comedia musical se ha producido en Broadway tres veces: 1983, 2004 y 2010, ganando en cada ocasin el Premio Tony al Mejor Musical del Ao. \n\n</p>\n\n<p>Ahora para deleite del pblico mexicano, est de regreso en una fastuosa versin que se presentar en el Teatro Hidalgo. Georges, el propietario de un centro nocturno en la Riviera Francesa y su pareja de muchos aos, Albn, un travesti, reciben la visita de Michel, el hijo de Georges. Michel est por contraer matrimonio y los padres de su novia - un poltico de ultraderecha y su conservadora esposa -quieren conocer a los futuros consuegros. Durante un fin de semana, Georges y Albn debern aparentar que llevan una vida \"normal\", dando pie a toda suerte de hilarantes enredos. A medida que avanza la trama, un emotivo desenlace sobre el verdadero significado del amor en pareja, la lealtad y el amor a los hijos, antecede a un espectacular cuadro musical.\n\n</p>\n\n<p>Elenco:\n\n</p><p></p><ul><li>Mario Ivn Martnez</li><li>Roberto Blandn</li><li>Aida Pierce</li><li>Israel Estrada</li><li>Rogelio Surez</li></ul><p></p>','2016-10-03 00:00:00','2016-10-08 23:59:00',30123,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33381/d93d97346ba8e6f8084de13477a9b27b201a7104.full.png',2,'obra,musical,jaula,locas,comedia,teatro','0000-00-00 00:00:00','0000-00-00 00:00:00'),(7,'Los Locos Surez Muere de la Risa! 50%','<br><p>Descuentos electrizantes que te harn araar la pared Pero corre, vuela y acelrate! pues estas ofertas slo duran 48 horas.\n\n</p>&nbsp;\n\n<p>S, leste bien 48 Horas! Tic, Tac Tic Tac<br></p><p>El show #1 de Stand-up Comedy interpretado por padre e hijo, expone de manera hilarante la forma en que todos somos victimas y victimarios de un modelo educativo que se repite sistemticamente en el mundo occidental.&nbsp;</p><p><br>\n\nElenco:<br>\n\n- Hctor Surez<br>\n\n- Hctor Surez Goms<br></p><p></p>','2016-10-03 00:00:00','2016-10-08 23:59:00',34606,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33382/5eaf01c62b0e6705c5125aba3fa68a8cededf7a7.full.png',49,'comedia,suarez,teatro,','0000-00-00 00:00:00','0000-00-00 00:00:00'),(8,'Paga $29 y obtn 30% de Descuento para \"I.D.I.O.T.A\"','<h4>IDIOTA\n\n</h4><p><strong>IDIOTA</strong> cuenta la experiencia de un hombre que se presenta a unas muy bien remuneradas pruebas psicolgicas que forman parte de un experimento de una importante fundacin, lo que el hombre cree una manera sencilla de solucionar sus problemas econmicos se convertir en una autntica trampa, tanto fsica como psicolgica, nos dice el autor Jordi Casanovas.\n\n</p><p>\n\nUn juego que situar al protagonista al lmite de su paciencia y su razn, y que retar al espectador a resolver los diferentes obstculos que se le presenten al protagonista.&nbsp;</p><p>\n\nIngeniosamente la trama nos lleva de la comedia, a la comedia negra y finalmente al thriller. Un oportunista (Jess Ochoa)  ingenioso y hasta parlanchn contra una psicloga (Itati Cantoral) dura y determinada a llevarlo al extremo. Un duelo de personalidades y actuaciones, de la risa a la intriga, es un artilugio teatral donde el espectador se cree ms inteligente que el personaje, el objetivo de la obra es descubrir hasta dnde hay que llegar para que las personas dejen de ser idiotas. Los ms probable es que al final sepamos cmo no ser idiotas.</p><p>Elenco:</p><p></p><ul><li>Itat Cantoral</li><li>Jess Ochoa&nbsp;</li></ul><p></p>','2016-10-03 00:00:00','2016-10-08 23:59:00',56496,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33387/a934d5af4677675ed7ace51e3f69d7646f71b47a.full.png',22,'obra,teatro,idiota,drama','0000-00-00 00:00:00','0000-00-00 00:00:00'),(9,'Paga $29 y obtn 50% Descuento para \"SCOOBY DOO El Musical\"','<h4>SCOOBY-DOO!\n\n</h4><p><strong>Scooby Doo!</strong> y su pandilla llegan al Teatro Banamex para resolver el misterio del teatro embrujado! En este musical en vivo, para toda la familia, ayudars a Shaggy, Fred, Daphne, Vilma y Scooby a resolver el misterio de un fantasma que recorre el teatro. Tu ayuda ser esencial para atrapar al malo. <strong></strong><strong>Scooby Dooby Doo! Scooby