hua atrapa con los secretos que guardan sus calles y minas. Es un pueblo enclavado en las montaas, donde se respira un aire puro y fresco. Sus calles empedradas estn enmarcadas por comercios donde se venden todo tipo de artesanas: desde esferas, artculos navideos y elementos decorativos, hasta cuadros de arte plumario, alfarera y fuentes de cantera.<br>\n\nAntiguo e importante pueblo minero, hoy en da El Oro conserva un encanto natural que sigue atrayendo al turismo. Con su Teatro Jurez, una joya de estilo neoclsico francs, y el mural del Palacio de Gobierno con influencia del art nouveau, atrae las miradas de los visitantes, quienes se internan en sus calles empedradas deseosos de saber un poco ms de su historia y su interesante pasado.</p><p><br>\n\nPintoresca escapada a 2 Pueblos Mgicos, 1 en Michoacn otro en Edo. Mex!</p>','2016-10-03 00:00:00','2016-11-17 23:59:00',41423,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33376/10a914a5bb7b5dcbc5208562f5541a0cfe0f23ad.full.jpg',79,'pueblos mgicos,tlalpujahua,el oro,michoacan,tour 1 dia,autobus,guia','0000-00-00 00:00:00','0000-00-00 00:00:00'),(24,'Tajn y Tecolutla Ruta de la Vainilla! Tour 1D c/transporte','<p>En medio de la selva, rodeada por el verde de los rboles y el azul del cielo, se alzan diversos edificios que conforman El Tajn, lo que alguna vez fue la capital de los totonacas.</p><p>Las estructuras de El Tajn conforman una de las metrpolis ms importantes del rea costera, cuya ubicacin estratgica la posicion como dentro de una importante ruta comercial que conectaba al Golfo de Mxico con la zona centro del pas. Cuenta con mltiples construcciones que, durante aos, han causado la admiracin de propios y extraos como templos, palacios y varias canchas de juego de pelota.</p><p>Tecolutla, conjugando en su nombre toda una serie de lugares paradisacos, el estado de Veracruz es en s mismo, una entidad turstica y cultural nica en su gnero.</p><p>\n\nUn tour arqueolgico inolvidable!</