los lamentos. Voces del pasado que quieren decirnos algo. Voces de autntico terror. El Circo de los Horrores nos traslada en esta ocasin a un antiguo manicomio del siglo XVIII, tenebroso y aparentemente olvidado lugar donde la locura no tiene lmites: <strong>\"El Manicomio del Circo de los Horrores\"</strong>. Un espacio siniestro y de alto riesgo en el que conviven, excntricos y resignados mortales, con peligrosos asesinos que esperan el fatal desenlace en la silla elctrica, el punto de no retorno. Todos conforman una curiosa familia de enajenados.&nbsp;</p><p>En el Manicomio, ingresa un personaje extremadamente ido y peligroso que se autoproclama rey de los vampiros descubrir que sus seguidores no son momias, hombres lobos ni nias posedas sino una marea de majaras terminales, de tocados del ala y de pirados. En el Manicomio, vigilado por viles guardianes sin escrpulos, trabajan torturadores cirujanos y enfermeras carniceras que destrozan cuerpos y cerebros bajo los efectos del delirio.&nbsp;</p><p>Dos intensas horas, en las que terribles acrbatas, excntricos malabaristas, inestables enfermeras sexis, ilusionistas chiflados, entumecidos trapecistas, monologuistas con alteraciones de la realidad, payasos degenerados, sonmbulas colgadas y equilibristas exhibicionistas arrastrarn al pblico a travs del inquietante mundo de la locura.</p><p><strong>QU ES EL MANICOMIO DE LOS HORRORES?\n\n</strong></p><p>El Manicomio del Circo de los Horrores es el resultado del xito primer show, El Circo de los Horrores, dando as continuidad a un trabajo que est dando la vuelta al mundo.&nbsp;</p><p>Una vez ms, en este nuevo espectculo, el Circo de los Horrores fusiona el teatro de vanguardia, el circo contemporneo y el cabaret ms salvaje, sus inconfundibles sellos de identidad, en el que prima el terror psicolgico y el humor cido y grotesco.&nbsp;</p><p>Y no podra haber mejor maestro de ceremonias para este gran acto que el menos humano de los seres conocidos: el mtico Nosferatu. Hacemos de este personaje una fiel rplica del original, con sus dos horas de maquillaje y vestuario plagado de prtesis (orejas, dientes, nariz, lentillas, alzas) y un sinfn de trucos escnicos que le darn una fantstica credibilidad y un gran impacto visual, consiguiendo un realismo sin precedentes.&nbsp;</p><p>Su aspecto, su extrema crueldad y su inestabilidad emocional, hacen de l el mejor gua para adentrarse en el Manicomio Circo de los Horrores, donde los que aqu nos encontramos esperndote estaremos encantados de recibir a toda persona vida de nuevas y diferentes experiencias. Y como todo maestro de ceremonias tiene su partener, quien mejor que Bitelsuso, el fantasma con peor carcter que existe en el inframundo. El terror, el humor negro y grandes dosis de adrenalina estn asegurados.</p><p>Pero que nadie sufra antes de tiempo, que todo llegar. Porque en El Manicomio del Circo de los Horrores tambin hay una increble escenografa, msica caera, baile y movimiento, muchos personajes, y espacio para el buen humor, la diversin y la risa, aunque sta sea histrica.&nbsp;</p><p>Buscamos la inmediatez y el impacto visual. El fluir de la adrenalina est asegurado desde antes de que comience el espectculo. Susto, impresin, miedo, mucho miedo..., y humor, mucho humor para calmar los nimos cuando el miedo llegue a su cenit. Y todo, absolutamente todo, aderezado con gusto y sensibilidad, velando siempre porque el espectador lo disfrute de verdad.&nbsp;</p><p><strong>Alguien se atreve?</strong></p>','2016-10-04 00:00:00','2016-10-19 23:59:00',43146,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33379/4a9735421f4f8231b8de087ef3156a6103c604d4.full.png',70,'obra,teatro,circo,manicomio','0000-00-00 00:00:00','0000-00-00 00:00:00'),(61,'Por qu las mujeres aman a los %#@? 50%','<p>\"Por qu Las Mujeres Aman A Los Pendejos\" es una obra de teatro que nos muestra el trasfondo de la gran duda que ha existido por todos los tiempos. Que es lo que los hombres hacen para gustarle a las mujeres y que es lo que a ellas les gusta de los hombres. Es una obra de teatro irreverente, llena de divertidas situaciones que en muchos, si no todos los casos, nos muestra la realidad de las parejas de la manera ms divertida posible.<br></p>','2016-10-04 00:00:00','2016-10-19 23:59:00',35458,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33422/893a03cd528d68675c3ff43fb902ea8242c57d13.full.png',48,'obra,pendejos,teatro,comedia','0000-00-00 00:00:00','0000-00-00 00:00:00'),(62,'12 Princesas en Pugna La comedia ms divertida! 62%','<p>Y vivieron felices para siempre. Cuntas veces escuchamos esta frase de pequeos? Qu equivocadas son esas palabras! <br>\n\nLos cuentos de hadas, en especial los relatos que Walt Disney tom para hacer algunas de sus pelculas, nos dan siempre una falsa idea de que la vida es tan fcil como enamorarse y llevar una vida plena. As, sin ms, el xito en la vida de las princesas y protagonistas de los cuentos infantiles ms populares radica en casarse con un prncipe azul y hacerlo feliz, an viniendo de un estrato social distinto.&nbsp;</p><p>\n\nLa Compaa Teatral Sueo Imposible nos invita a conocer otro lado, ms divertido y realista, de la vida de las 12 princesas de los cuentos de hadas. <br></p>','2016-10-04 00:00:00','2016-10-19 23:59:00',50480,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33423/7c7ee5a72d8cd8c7c7431bebdbfe77f6c3e12cb0.full.jpg',92,'Teatro,Princesas,','0000-00-00 00:00:00','0000-00-00 00:00:00'),(63,'Esquizofrenia VENTA EXCLUSIVA Podrs Escapar? 50%','<p>Esquizofrenia es un proyecto que busca reinventar el genero del miedo y suspenso, llevando el terror a un nuevo nivel vivencial, en donde los participantes podrn vivir en primera persona la peor de las pesadillas.\n\n</p><p>El evento consta de un intenso recorrido en el cual se privara de los sentidos visuales y auditivos en trayectos especficos y posteriormente expuestos a patrones de deslumbramiento especficos estimulando las percepciones del participante.\n\n</p><p>Los participantes entraran en un estado de \"psicosis inducido\", escucharas voces, veras cosas que no estn ah, no sabrs quien te habla, quien te toca, ni quien esta atrs de ti, no podrs confiar en tus sentidos, no podrs diferenciar lo que es real y lo que no.&nbsp;</p>','2016-10-04 00:00:00','2016-10-19 23:59:00',25088,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33434/7fe46ff92387c34447209225d3358a1a77771c6c.full.png',26,'esquizofrenia,terror,exclusivo,nopodrasescapar','0000-00-00 00:00:00','0000-00-00 00:00:00'),(64,'Cinturilla Colombiana en Ltex para Mujer 60%','<p><br></p><p>Tiene varillas que dan su apoyo para la espalda y una buena postura corporal; y el cierre frontal de gancho para asegurar la compresin. Cuenta con algodn hipoalergnico suave forro interior para proporcionarle una sensacin cmoda en forma y fresco mientras que lo lleva puesto. Los mejores vestidos sin tirantes debajo para una ocasin muy especial!</p>\n\n<p>Ayuda a adelgazar en su abdomen y la cintura para llevar a cabo-curvas naturales! Adems de que tiene barras de metal en el lado de deshuesado, para ayudar a su cuerpo para estar en una buena postura. Este producto contiene ltex.\n\n</p>\n\n<p>Si usted es alrgico o altamente sensibles al ltex, este producto puede no ser adecuado para usted. Featuresfocus en la cintura. Desgaste cinchers de la cintura vedette meticulosamente diseadas, que envuelve su figura, lo que te da las curvas sensuales y una cintura ms delgada.\n\n</p>\n\n<p>Cuenta con cierre frontal de gancho para la seguridad mientras que le da la compresin nica a solo vedette puede dar. Traer en prendas modeladoras firme control de vedette fabricada con tecnologa avanzada de ltex con memoria de forma y capacidad de elongacin que proporciona una compresin nica mostrando curvas sensuales prendas vedette slo puede dar. Hecho de nylon, ltex, algodn y el cors spandexthe vedette ha sido 