as por calaveras y otros seres del \"ms all\", quienes permitirn a los asistentes -incluso a los ms pequeos- disfrutar de una de las fiestas ms emotivas del calendario mexicano: el Da de Muertos.<br>\n\nAqu tienes una buena opcin para disfrutar de nuestras tradiciones!</p>','2016-10-04 00:00:00','2016-10-24 23:59:00',76568,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33418/51321f337e1d0637212f66d394e7711ee9564544.full.jpg',65,'xochitla,tradiciones,festival,muertos,tepotzotlan,tour 1 dia,guia,transporte','0000-00-00 00:00:00','0000-00-00 00:00:00'),(67,'Juego de Pelota Prehispnico en Teotihuacn! TOUR 1DA','<p>Distintos indicadores arqueolgicos permiten suponer que el juego de pelota era una actividad conocida y practicada en la antigua ciudad de Teotihuacn. Las imgenes plasmadas en el mural de Tepantitla hacen alusin a distintas maneras de jugar a la pelota en espacios abiertos donde se utilizaban marcadores mviles y, posiblemente, en una cancha limitada por estructuras paralelas.</p><br><p>Disfruta de una parte de nuestra historia!</p>','2016-10-04 00:00:00','2016-10-26 23:59:00',8510,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33420/6071dd85551ce4b56911bc9890253d04d209f0c2.full.jpg',20,'teotihuacan,juego de pelota,tour 1 dia,tranvia,cuevas,talleres','0000-00-00 00:00:00','0000-00-00 00:00:00'),(68,'LA LLORONA en Teatro Silvia Pinal No Volvers a Dormir! 61%','<p>Una Leyenda que ha motivado innumerables expresiones Artsticas en las diferentes aristas del Arte, pero que de manera particular, se ha sabido arraigar en lo ms profundo de la memoria de los habitantes de la ciudad y que an hoy en da, se divulga entre los diferentes Pueblos, Calles, Plazas Pblicas y Recintos del Pas.&nbsp;\n\n</p><p>Con ms de 2000 representaciones a lo largo del Pas, Centro Amrica y el Caribe, durante ms de 15 aos ininterrumpidos, hemos fungido como dignos y humildes exponentes de la Cultura Mexicana a travs de este Relato; La Llorona, ha significado para m y mis compaeros, ms que una fuente de trabajo; nos ha permitido Comprender y reflexionar sobre la Importancia de dar a las Leyendas de nuestro Pas el lugar que se merecen como parte de nuestro Patrimonio. &nbsp;</p><p>Hablando a ttulo personal, no conozco persona alguna  a las que he llevado la Obra de Teatro La Llorona, que no haya escuchado sobre la misma y su penoso lamento. En este espectculo la msica, escenografa e interpretacin del elenco transporta al espectador al suspenso, al miedo y al terror, as que<strong>NO DORMIRN JAMAS!</strong></p>','2016-10-04 00:00:00','2016-10-31 23:59:00',92682,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33433/af80b21c8d8b85a0400f5681fb4d3a1f07dfc33e.full.png',99,'obra,teatro,terror,llorona','0000-00-00 00:00:00','0000-00-00 00:00:00'),(69,'Cuidado ntimo Porque lo mereces! ','<p>Los cuidados personales son una parte importante del da a da, la intimidad es de mayor importancia por lo que traemos para ti unas opciones para tu cuidado, t eliges la que ms te convenga.&nbsp;</p><br><p>T eres lo ms imporatnte!&nbsp;</p>','2016-10-04 00:00:00','2016-11-04 23:59:00',24454,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33393/713ad40a76fbaac6a828f2d0887acf6df5e31330.full.png',3,'cuidado ntimo ','0000-00-00 00:00:00','0000-00-00 00:00:00'),(70,'Live Game ZOMBIE TOM Captulo 2 + Cuarto Escape Laboratorio','<p><strong>TOM Captulo 2\n\n</strong></p><p>Este es el primer live game en Mxico en donde se puede vivir un apocalipsis zombie, donde se tendr que ingresar a un hospital infectado para cumplir con 2 objetivos: terminar con los zombies (disparando con rplicas de airsoft) y descubrir que pas resolviendo acertijos. El juego posee tres niveles de dificultad y cuenta con equipo de proteccin: casco, chaleco, guantes, coderas y rodilleras.</p><p>Termina con los infectados y resuelva acertijos para cumplir tu misin. &nbsp; &nbsp;</p>\n\n\n\n\n\n<p>