16-10-06 00:00:00','2016-10-27 23:59:00',95845,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33586/66f2df647bcc2e55def906674e2c176321dcca3b.full.jpg',91,'festival,almas,valle de bravo,evento,cultural,artistico,tour 1 dia,transporte','0000-00-00 00:00:00','0000-00-00 00:00:00'),(196,'Festival de las Calacas en San Miguel  Tradiciones!','<p>La Calaca es un festival anual de arte y cultura participativa en San Miguel de Allende, Mxico, que se integra a las celebraciones traditionales de Da de Muertos. Este 2016 La Calaca te ofrece cuatro das de arte, talleres, conferencias, espectculos, desfiles y fiestas que honran, promueven y exploran los temas y tradiciones que extisten entre la vida y la muerte. La muerte pertenece tanto a la vida como la vida pertenece a la muerte y por esto te invitamos a celebrarla.</p><br><p>Experiencias nicas, llenas de tradicin!</p>','2016-10-06 00:00:00','2016-10-27 23:59:00',73216,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33587/327a93742a546a6e0216b7790765298f4e9a24e8.full.jpg',83,'festival,almas,valle de bravo,evento,cultural,artistico,tour 1 dia,transporte','0000-00-00 00:00:00','0000-00-00 00:00:00'),(197,'Espectculo de La Llorona! LTIMOS LUGARES ','<p>Acatla y la compaa de arte escnica Achicatzin tienen el honor de invitar a su temporada de da de muertos presentando la obra de la llorona en el embarcadero de Tlhuac (Lago de los Reyes Aztecas).</p><p>El Da de Muertos es una de las fechas favoritas de los capitalinos; la ciudad se pinta de amarillo por la flor de cempacchil, el olor a incienso invade las calles y las calaveritas adornan por doquier.&nbsp;</p><p>Si te preguntas A donde ir el Da de Muertos en la Cd. de Mxico? Esta es una excelente opcin....</p>','2016-10-06 00:00:00','2016-10-28 23:59:00',8597,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33590/c6c3f8070b0ea3eaeee096f772cc29fb3b1fa098.full.jpg',67,'festival,almas,valle de bravo,evento,cultural,artistico,tour 1 dia,transporte','0000-00-00 00:00:00','0000-00-00 00:00:00'),(198,'El Confesor A quin le cuentas tus pecados? 50%','<p>Una historia basada en hechos reales que nos presenta el encuentro  de un cura con un personaje singular y obscuro de una habilidad sorprendente para sembrar dudas y probar la fortaleza emocional y espiritual cuando pone a luz y en tela de juicio la moralidad del ser humano en toda su extensin.&nbsp;</p><p>Habr muchas cosas que descubrir, secretos, ambiciones, deseos&nbsp;</p><p>Suspenso llevado al lmite. Y t, a quin le cuentas tus pecados?</p>','2016-10-06 00:00:00','2016-10-29 23:59:00',29500,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33523/2c8451bad8066088fa99fa2f70757a8df13a5be3.full.png',26,'teatro,el confesor','0000-00-00 00:00:00','0000-00-00 00:00:00'),(199,'15 servicios para decir ADIS a los KILITOS extra ','Qutate ese PESO de encima y sintete mas Guapa que nunca. Luce toda la Ropa que tanto te gusta','2016-10-06 00:00:00','2016-11-17 23:59:00',58224,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33510/29c715cf3121260f25d944ef977d6d0888ce828d.full.png',0,'baja de peso,kilos ,reduce,adelgaza,cavitaciones ','0000-00-00 00:00:00','0000-00-00 00:00:00'),(200,'Levantamiento de Glteo','<p>A todo el mundo le encantara tener las curvas perfectas, sin embargo los efectos del envejecimiento dan como resultado piel floja y reduccin de la firmeza corporal. No obstante, el progreso tecnolgico actual permite a la persona reactivar mejor su fsico. Tener un cuerpo atractivo, aumenta la autoconfianza.&nbsp;</p><p>Por lo tanto, asi como el aumento de senos puede dar a la persona los senos perfectos, un aumento de glteos puede brindar a la paciente una apariencia ms atractiva y deseable.</p>','2016-10-06 00:00:00','2016-11-17 23:59:00',35848,'https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33514/598079ab539a5bfec481b7ce67c8